INSERT INTO `toc_email_templates_description` VALUES (1,1,'Welcome to %%store_name%%','<p>%%greeting_text%%</p><br /><br /><p>We welcome you to %%store_name%%!</p><br /><br /><p>You can now take part in the various services we have offer for you. Some of these services include:</p><br /><br /><ul><br /><li>Permanent Cart - Any products added to your online cart remain there until you remove them, or check them out.<br /><li>Address Book - We can now deliver your products to another address other than yours! This is perfect to send birthday gifts direct to the birthday-person themselves.<br /><li>Order History - View your history of purchases that you have made with us.<br /><li>Products Reviews - Share your opinions on products with our other customers.<br /></ul><br /><p>For help with any of our online services, please email the store-owner: %%store_owner_email_address%%.</p><br /><br />Note: This email address was given to us by one of our customers. If you did not signup to be a member, please send an email to the store owner.'),(2,1,'Password Reminder to TomatoCart','A new password was requested from %%customer_ip_address%%.<br /><br />Your new password to %%store_name%% is:<br /><br />%%customer_password%%<br /><br />For help with any of our online services, please email the store-owner: %%store_owner_email_address%%.<br /><br />Note: If you did not request this action via our password forgotten page, please notify the store owner as soon as possible.'),(3,1,'Your friend %%from_name%% has recommended this great product from %%store_name%%','Hi %%to_name%%!<br /><br />Your friend, %%from_name%%, thought that you would be interested in %%product_name%% from %%store_name%%.<br /><br />%%message%%<br /><br />To view the product click on the link below or copy and paste the link into your web browser:<br /><br />%%product_link%%<br /><br />Regards,<br /><br />%%store_name%% <br />%%store_address%%'),(4,1,'Order Process','TomatoCart<br />------------------------------------------------------<br />Order Number: %%order_number%%<br />Detailed Invoice: %%invoice_link%%<br />Date Ordered: %%date_ordered%%<br /><br />%%order_details%%<br /><br />Delivery Address<br />------------------------------------------------------<br />%%delivery_address%%<br /><br />Billing Address<br />------------------------------------------------------<br />%%billing_address%%<br /><br />Order Status: %%order_status%%<br />------------------------------------------------------<br />%%order_comments%%'),(5,1,'Order Update (%%store_name%%)','%%store_name%%<br />------------------------------------------------------<br />Order Number: %%order_number%%<br />Detailed Invoice: %%invoice_link%%<br />Date Ordered: %%date_ordered%%<br /><br />Order Comment<br />------------------------------------------------------<br />%%order_comment%%<br /><br />Order Status<br />------------------------------------------------------<br />New Status: %%new_order_status%%<br /><br />Please reply to this e-mail if you have any questions regarding this order.'),(6,1,'Welcome to %%store_name%%','%%greeting_text%%<br /><br />We welcome you to %%store_name%%.<br /><br />You can now take part in the various services we have to offer you. Some of these services include:<br /><br />* Permanent Shopping Cart - Any products added to your online shopping cart remain there until you purchase or remove them<br />* Address Book - Products can be delivered to any addresses you define in your address book! This is perfect to send gifts directly to the customers.<br />* Order History - The previous orders you have made can be viewed online.<br />* Product Reviews -  Share opinions about products with other customers.<br /><br />For help with any of our online services please email us at: %%store_owner_email_address%%<br />Please note: This account has been created for you by the store owner. <br /><br />Please use your e-mail address with the following password as your login account: %%password%%'),(7,1,'Inquiry from %%store_name%%','%%greeting_text%%<br /><br />We noticed that during a visit to our store you placed the following item(s) in your shopping cart, but did not complete the transaction.<br /><br />Shopping Cart Contents:<br /><br />%%shopping_cart_contents%%<br /><br />Comment:<br /><br />%%comment%%<br /><br />We are always interested in knowing what happened and if there was a reason that you decided not to purchase at this time. If you could be so kind as to let us know if you had any issues or concerns, we would appreciate it. <br /><br />We are asking for feedback from you and others as to how we can help make your experience at %%store_name%% better.<br /><br />PLEASE NOTE:<br /><br />If you believe you completed your purchase and are wondering why it was not delivered, this email is an indication that your order was NOT completed, and that you have NOT been charged! Please return to the store in order to complete your order.<br /><br />Our apologies if you already completed your purchase, we try not to send these messages in those cases, but sometimes it is hard for us to tell depending on individual circumstances.<br /><br />Again, thank you for your time and consideration in helping us improve the %%store_name%%.<br /><br />Sincerely,<br />%%store_name%%'),(8,1,'You have received a coupon from %%store_name%%','%%greeting_text%%<br /><br />You have received a coupon from %%store_name%%. You can redeem this coupon during checkout. Just enter the code in the box provided, and click on the redeem button.<br /><br />The coupon code is: %%coupon_code%%<br /><br />Don\'t lose the coupon code, make sure to keep the code safe so you can benefit from this special offer.<br /><br />%%addtional_message%%'),(9,1,'You have receive a store credit from administrator','%%greeting_text%% <p> The administrator has updated your store credits. Now you have %%customer_credits%% credits in your account. </p>'),(10,1,'Your friend %%from_name%% want to share his wishlist from %%store_name%%','Hi!<br /><br />Your friend %%from_name%% want to share his wishlist from %%store_name%%.<br /><br />%%message%%<br /><br />To view the wishlist click on the link below or copy and paste the link into your web browser:<br /><br />%%wishlist_url%%<br /><br />Regards,<br /><br />%%store_name%% <br />%%store_address%%'),(11,1,'You have received a gift certificate from %%recipient_name%%','Dear %%recipient_name%%,<br /><br />You have received a gift certificate from %%sender_name%%. You can redeem this gift certificate during checkout. Just enter the code in the box provided, and click on the redeem button.<br /><br />The gift certificate amount is %%gift_certificate_amount%% and  the gift certificate code is: %%gift_certificate_code%%<br /><br />Don\'t lose the gift certificate code and make sure to keep the code safe.<br /><br /><b>%%gift_certificate_message%%</b><br /><br />Regards,<br /><br />%%store_name%% <br />%%store_owner_email_address%%'),(12,1,'The download link for %%downloadable_products%% is actived','Dear %%customer_name%%,<br /><br />The download link for the products you purchased from store %%store_name%%: <br /><br />%%downloadable_products%%<br /><br />is actived.<br /><br />Please go to the orders area of \"My Account\" and download the products.<br /><br />%%download_link%%<br /><br />Regards,<br /><br />%%store_name%% <br />%%store_owner_email_address%%'),(13,1,'A new credit slip is created for returned products','Dear %%customer_name%%,<br /><br />A new credit slip is created for following returned products:<br /><br /> %%returned_products%% <br /><br />from order %%order_number%%. The slip number is %%slip_number%% and the total amount is %%total_amount%%. You can print out the credit slip in the \"My Acount\" area. <br /><br />Regards,<br /><br />%%store_name%% <br />%%store_owner_email_address%%'),(14,1,'New store credit is created for returned products','Dear %%customer_name%%,<br /><br />New store credit is created for following returned products:<br /><br /> %%returned_products%% <br /><br />from order %%order_number%%. The total amount is %%total_amount%% and the store credit is made to your billing account so that it can be used for future purchases. <br /><br />Regards,<br /><br />%%store_name%% <br />%%store_owner_email_address%%'),(15,1,'Administrator Password Reminder to TomatoCart','A new password was requested from %%admin_ip_address%%.<br /><br />Your new password is:<br /><br />%%admin_password%%<br /><br />Regards,<br /><br />%%store_name%% <br />%%store_owner_email_address%%'),(16,1,'Product out of Stock','TomatoCart<br>---------------------------------------------------<br>%%products_name%% %%products_variants%% is out of stock.<br>---------------------------------------------------<br>Remaining stock: %%products_quantity%%. You are advised to turn <br>to the Products section in the admin panel to replenish the inventory.');
